INSERT INTO `produk` (`id_produk`, `nama_produk`, `harga_produk`, `tgl_rilis`, `detail_produk`, `vendor`, `gambar`, `diskon`, `kategori_id_kategori`) VALUES
(2015, 'Huntsman V2 Analog', 4299000, '2021-02-09', ' About this item\r\n\r\n-  The #1 Best-Selling Gaming Peripherals Manufacturer in the US: Source - The NPD Group, Inc. U.S. Retail Tracking Service, Keyboards, Mice, PC Headset/Pc Microphone, Gaming Designed, based on dollar sales, 2017-2021\r\n-  Razer Analog Optical Switches: Set a desired actuation point to suit your playstyle, or use analog input for smoother, more nuanced control—doing away with rigid 8-way WASD movement for true 360-degree motion\r\n-  Doubleshot PBT keycaps: Harder and more durable than ABS, these tough keycaps won’t wear down to a shiny finish and have labels which will never fade thanks to their doubleshot molding process\r\n-  Powered by Razer Chroma RGB: With 16.8 million colors and a suite of effects, sync its keys and underglow with the rest of your battlestation, and enjoy greater immersion as it dynamically reacts with over 150 integrated games\r\n-  Ergonomic, Magnetic Wrist Rest: Made of plush leatherette to maximize comfort over extended gaming sessions (with built-in underglow lighting)\r\n-  Multi-function Digital Dial and 4 Media Keys: Configure them to pause, play, skip and tweak everything from brightness to volume—the ultimate convenience as you enjoy your entertainment\r\n-  USB 3.0 passthrough: Instead of reaching over to your rig to plug in a device, you can connect it conveniently to your PC via a USB port in the Razer Huntsman V2 Analog\r\n', 'Razer', , 0, 1802);
INSERT INTO `produk` (`id_produk`, `nama_produk`, `harga_produk`, `tgl_rilis`, `detail_produk`, `vendor`, `gambar`, `diskon`, `kategori_id_kategori`) VALUES
(2016, 'Viper Mini', 899000, '2020-03-04', ' About this item\r\n\r\n-  Lightest, Zero-Compromise Miniature Mouse: 10% Smaller Than the Viper and lighter at 61g, with a 8500 DPI optical sensor befitting the most serious gamers without the need for drilling holes in the chassis like competitor mice\r\n-  Faster Than Traditional Mechanical Switches: Razer optical mouse switches uses light beam-based actuation, registering button presses at the speed of light for absolute control\r\n-  Customizable Chroma RGB Color Profiles & Underglow: Includes 16.8 million color combinations w/ included preset profiles\r\n-  6 Programmable Buttons: Allows for reconfiguration and assignment of complex macro functions through Razer Synapse 3\r\n-  Drag-Free Cord for Wireless-Like Performance: Razer Speedflex cables eliminate the need for mouse bungees, drastically reducing weight and drag', 'Razer', , 0, 1801);
INSERT INTO `produk` (`id_produk`, `nama_produk`, `harga_produk`, `tgl_rilis`, `detail_produk`, `vendor`, `gambar`, `diskon`, `kategori_id_kategori`) VALUES
(2017, 'QcK Limited', 950000, '2016-12-01', ' About this item\r\n\r\n-  Surface legacy: building upon SteelSeries’ 15 year legacy of gaming mousepads, the Qck Limited is the pinnacle of surface performance and innovation\r\n-  Never fray stitching: understitching along the edges of the surface ensure it will never fray or peel\r\n-  Pixel perfect accuracy: tested by top sensor Manufacturer PixArt, the high thread count and Surface variation optimizes tracking accuracy for both Optical and laser sensors\r\n-  Micro woven cloth: engineered to improve mouse glide, the micro woven cloth has minimal friction and a silky smooth texture\r\n-  Non slip base: Durable rubber base stays in place, providing a solid platform for competitive gaming Qck Limited Dimensions 12 6 W x 10 63 H x 12 D\r\n', 'Steelseries', , 80, 1804);
INSERT INTO `produk` (`id_produk`, `nama_produk`, `harga_produk`, `tgl_rilis`, `detail_produk`, `vendor`, `gambar`, `diskon`, `kategori_id_kategori`) VALUES
(2018, 'Arctis 1 Wired', 800000, '2019-06-05', ' About this item\r\n\r\n-  Wired gaming headset with universal connectivity for all platforms including PC PS4 Xbox switch and lite and mobile via standard 3.5 millimeter connection\r\n-  Features the critically acclaimed signature audio of the Arctis line for precisely balanced incredibly realistic in game audio\r\n-  Widely recognized as the best mic in gaming Arctis ClearCast bidirectional microphone delivers studio quality voice clarity and background noise cancellation\r\n-  Padded air weave ear cushions and adjustable steel reinforced headband provide long lasting comfort and durability\r\n-  Detachable microphone low profile design and fold flat earcups for non-gaming occasions and convenience on the go\r\n-  SteelSeries cannot guarantee the quality or authenticity of products sold by non-authorized resellers on Amazon, and they are not eligible for warranty.\r\n', 'Steelseries', , 10, 1803);
INSERT INTO `produk` (`id_produk`, `nama_produk`, `harga_produk`, `tgl_rilis`, `detail_produk`, `vendor`, `gambar`, `diskon`, `kategori_id_kategori`) VALUES
(2022, 'Cloud II', 800000, '2015-02-09', ' Designed for comfort: Exceptionally comfortable memory foam ear cushions and padded leatherette headband help keep you focused on gaming\r\nSupreme audio quality: Large 53 millimeter drivers provide high-quality audio. Hear in-game details better and get the in-game advantage on your opponents\r\n7.1 virtual surround sound: Truly immerse yourself in your games with hardware-driven virtual 7.1 surround sound for precisely located audio\r\nPassive noise cancellation: The closed ear cup design blocks out outside distractions to keep you in the game\r\nBuilt to last: The solid, durable aluminum frame is built to withstand the blows of daily use\r\nDetachable, noise-cancelling microphone: TeamSpeak and Discord certified so you can chat with your friends and your callouts will be heard loud and clear\r\nCompatibility: 7.1 virtual surround sound on PC & Mac. Stereo on PS4, Xbox One, Nintendo Switch, and mobile devices\r\n#1 best-selling PC gaming headset brand in the US. source: The NPD group, inc., U.S. retail tracking service, PC headset / PC microphone, gaming designed, Jan. 2018-Dec. 2019 ', 'HyperX', , 0, 1803);
INSERT INTO `produk` (`id_produk`, `nama_produk`, `harga_produk`, `tgl_rilis`, `detail_produk`, `vendor`, `gambar`, `diskon`, `kategori_id_kategori`) VALUES
(2023, 'K2 HOT SWAP', 1499000, '2021-04-15', ' A hot-swappable 75% layout (84 keys) white LED backlight bluetooth mechanical keyboard in a compact design that’s built for productivity and a tactile typing experience. Personalize per-key typing experience without soldering, you can alter every switch on the K2 hot-swappable version with ease.\r\nConnects with up to 3 devices via Bluetooth and switch among them easily. With high reliable and broad compatibility Broadcom Bluetooth 5.1 chipset, the K2 is best to fit home, office and light gaming use while connecting with your smartphone, laptop and iPad. It also has wired mode with USB Type-C connection.\r\nWith a unique Mac layout, the K2 has all the necessary Mac function keys while still being compatible with Windows. Extra keycaps for both Windows and Mac operating systems are included. Engineered with double-shot ABS keycap set allows backlight shine through the legends with a subtle feeling.\r\nThe K2 can last up to 240 hours (with backlit disabled) with a 4000 mAh big battery, which is one of the biggest in mechanical keyboards. N-key rollover (NKRO) on wired mode or 6KRO on wireless mode.\r\nThe K2 gives the freedom to customize your typing experience with its hot-swappable PCB. With the pre-installed Gateron Blue switch providing unrivaled tactile responsiveness on the clicky Blue switch with a durable50 million keystroke lifespan. The K2 has enchanting white LED backlight with modern keycap legends that sync with your mood; available in static white or flashing light mode. ', 'Keychron', , 0, 1802);
INSERT INTO `produk` (`id_produk`, `nama_produk`, `harga_produk`, `tgl_rilis`, `detail_produk`, `vendor`, `gambar`, `diskon`, `kategori_id_kategori`) VALUES
(2024, 'GM190', 195000, '2020-11-13', 'GM190 adalah produk terbaru dari dbE untuk gaming headset\r\n\r\nDengan pengalaman kami dalam dunia gaming headset selama 3 tahun, kami mendesain sebuah gaming headset yang lebih nyaman dari sebelumnya dengan harga sangat terjangkau. Headset ini memiliki desain over the ear sehingga tidak menekan daun telinga dan sangat ringan untuk ukurannya sehingga nyaman digunakan waktu lama\r\n\r\nKarakter suaranya didesain selayaknya sebuah headset gaming dengan suara flat sehingga seluruh detail dalam game dapat terdengar dengan jelas.\r\n\r\nMicrophone headset ini juga didesain sehingga memiliki sensitivitas lebih baik dari sebelumnya\r\n\r\nFitur-fitur headphone ini :\r\n– Sangat nyaman digunakan karena over the ear dan sangat ringan\r\n– Sistem headband yang diperbaharui sehingga bobot headset yang ringan terdistribusi dengan sempurna\r\n– Karakter suara yang disesuaikan dengan keperluan gaming', 'dbE', , 0, 1803);
INSERT INTO `produk` (`id_produk`, `nama_produk`, `harga_produk`, `tgl_rilis`, `detail_produk`, `vendor`, `gambar`, `diskon`, `kategori_id_kategori`) VALUES
(2025, 'Blackwidow X Chroma', 1300000, '2016-03-01', ' Signature Mechanical Switch for Gaming: Razer Green switch technology provides a satisfying clicky sound with 50 G of actuation force, ideal for typing and gaming requiring the highest accuracy\r\nImmersive, Customizable Chroma RGB Lighting: Includes 16.8 million colors w/ included preset profiles on individually backlit keys; syncs with gameplay and Razer Chroma enabled peripherals and Philips Hue products\r\nFully Programmable Macro Support: Razer Hypershift allows for all keys and keypress combinations to be remapped to execute complex commands\r\nMilitary Grade Metal Construction: Built to last, with a rugged, metal top top plate for minimal flex and enhanced sturdiness\r\nDurable Construction: Supports up to 80 million clicks with a 2 year manufacturer warranty ', 'Razer', , 0, 1802);
INSERT INTO `produk` (`id_produk`, `nama_produk`, `harga_produk`, `tgl_rilis`, `detail_produk`, `vendor`, `gambar`, `diskon`, `kategori_id_kategori`) VALUES
(2026, 'Daxa Pro Wireless', 700000, '2020-05-20', 'DAXA merupakan mouse gaming premium yang akan menambah performa bermain kamu dengan fitur nirkabel 2,4G-nya, yang menjamin pergerekan mouse yang lebih bebas dan zero delay. Dilengkapi dengan chipset sensor PIXART PAW3335, yang merupakan sensor mouse terbaik khusus nirkabel, mempunyai tingkat sensitivitas yang tinggi dengan akurasi dan akselerasi maksimal.\r\nFitur Spesial DAXA\r\n\r\n    Koneksi dual mode, kabel dan nirkabel 2.4G\r\n    Desain ergonomis dengan pola genggaman yang mantap\r\n    RGB LED dilengkapi dengan tombol daya dan perangkat lunak untuk pengaturan\r\n    Menggunakan kabel paracord yang diklaim dapat memaksimalkan lalu lintas sinyal antara mouse dengan PC.\r\n    Pengisi daya nirkabel dengan teknologi Qi\r\n    Switch Omron berdurabilitas 20 juta klik\r\n    Tiga pilihan level polling rate dengan tingkat maksimal 1000Hz (durasi respon 1mikro detik)\r\n    Konsumsi daya rendah dengan teknologi auto sensor', 'Rexus', , 0, 1801);

